import React from "react";
import Nav from "./nav/nav.jsx";
import Link from "next/link";
import "./style.less";
export default function Index() {
  return (
    <div>
      <svg
        class="MuiSvgIcon-root"
        focusable="false"
        viewBox="0 0 24 24"
        aria-hidden="true"
        role="presentation"
      ></svg>
      <Nav></Nav>
    </div>
  );
}
